Id *DataModel::arboretum_node_for(bool b) {
  if (b) {
    return true_;
  } else {
    return false_;
  }
}

Id *DataModel::arboretum_node_for(const std::string &s) {
  return arboretum_create_named_node(s.c_str());
}

Id *DataModel::arboretum_node_for(const char *s) {
  return arboretum_create_nameless_node_with_props(
      arboretum_create_value_string(s));
}

Id *DataModel::arboretum_node_for(uint64_t i) {
  return arboretum_create_nameless_node_with_props(
      arboretum_create_value_unsigned(i));
}

Id *DataModel::arboretum_node_for(int64_t i) {
  return arboretum_create_nameless_node_with_props(
      arboretum_create_value_signed(i));
}

Id *DataModel::arboretum_node_for(double d) {
  return arboretum_create_nameless_node_with_props(
      arboretum_create_value_double(d));
}

Id *DataModel::arboretum_node_for(Id *item_class, const std::vector<Id *> &v) {
  Id *result = arboretum_create_nameless_node();

  // Nameless node props
  arboretum_create_edge(result, meta_class_, builtin_list_class_);
  arboretum_create_edge(result, builtin_list_size_,
                        arboretum_node_for(v.size()));
  arboretum_create_edge(result, builtin_list_item_class_, item_class);

  for (size_t i = 0; i < v.size(); ++i) {
    arboretum_create_edge(result, arboretum_node_for(i), v[i]);
  }

  return result;
}

Id *DataModel::arboretum_node_for(Id *item_class,
                                  const std::unordered_set<Id *> &s) {
  Id *result = arboretum_create_nameless_node();
  arboretum_create_edge(result, meta_class_, builtin_set_class_);
  arboretum_create_edge(result, builtin_set_item_class_, item_class);
  arboretum_create_edge(result, builtin_set_size_,
                        arboretum_node_for(s.size()));

  for (auto e : s) {
    arboretum_create_edge(result, builtin_set_item_, e);
  }

  return result;
}

